import React from  'react';
import axios from 'axios';
import { makeStyles } from '@mui/styles';
import { Typography, Button, Grid, TextField } from '@mui/material'

import DisplayAppBar from './DisplayAppBar';

export default function WelcomePage() {

    const handleLoginClicked = () => {
        console.log("Login button clicked");
    };

    return (
        <div>
            <DisplayAppBar />
            <Grid container direction="column" justifyContent="center" alignItems="center" spacing={2} >
                <Grid item>
                    <TextField required label="Username" variant="outlined" id="username"/>
                </Grid>
                <Grid item>
                    <TextField required label="Password" variant="outlined" id="password"/>
                </Grid>
                <Grid item>
                    <Button variant="=outlined" onClick={handleLoginClicked}>Login</Button>
                </Grid>
            </Grid>
        </div>
    )
};
